import React from 'react';
import './MyStory.css';

function MyStory() {
  return (
    <div className='mystory'>
        <h1 className='title'>LA MIA STORIA</h1>
        <div className="container">
            <div className="container">
                <ul className="items">
                    <img src="images/img-10.jpg" alt="la mia storia" className="item_image" />
                </ul>
            </div>
        </div>
    </div>
  )
}

export default MyStory;
